import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import { makeStyles } from '@material-ui/core/styles';
import { useState } from 'react';
import { FormHelperText } from '@material-ui/core';


function Selector( props ) {

    const classes = useStyles();
    const [state, setState] = useState('');

    const handleChange = (event) => {
        setState(event.target.value);
    }
    
    return (
        <FormControl className={classes.formControl} autoWidth={true}>
            <Select
                className={classes.selectItem}
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={state}
                onChange={handleChange}
                MenuProps={{
                    getContentAnchorEl: null,
                    anchorOrigin: {
                      vertical: "bottom",
                      horizontal: "left",
                    },
                    PaperProps: {
                        style: {
                            width: 100,
                        }
                    }
                  }}
                >
                <MenuItem value={10} className={classes.menuItem}>Points per game</MenuItem>
                <MenuItem value={20} className={classes.menuItem}>Points per gamePoints per gamPoints per game</MenuItem>
                <MenuItem value={30} className={classes.menuItem}>Thirty</MenuItem>
            </Select>
        </FormControl>
    )
    
}

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        width: 180,
        backgroundColor: 'white',
    },
    selectItem:{
        minWidth: 180,
        fontSize: "14px",
    },
    selectEmpty: {
        marginTop: theme.spacing(2)
    },
    menuItem: {
        fontSize: "10px",
    },

  }));

export default Selector;
